import React from 'react';
import Nav from './Nav'
import './CSS/Contact.css'

export default class Contact extends React.Component{

    typing =()=>{
        var i = 0;
        var txt = 'E-mail: anasalam027@gmail.com Phone Number: +91 70448 04030 Social Media Handles:';
        var speed = 50;

        if (i < txt.length) {
            document.getElementsByTagName("p").innerHTML += txt.charAt(i);
            i++;
            setTimeout(this.typing, speed);
        }
    };

    render(){
        return(
            <>
            <Nav/>
            <div className="contact-box">
                <p className="contact">
                    {this.typing()}
               </p>
            </div>
            </>
        );
    }
}
